pub enum XmlError {
    IO(IOError),
    Parser(ParserError),
    Utf8(Utf8Error),
    UnexpectedEof,
    UnexpectedToken {
        token: String,
    },
    TagMismatch {
        expected: String,
        found: String,
    },
    MissingField {
        name: String,
        field: String,
    },
    UnterminatedEntity {
        entity: String,
    },
    UnrecognizedSymbol {
        symbol: String,
    },
    FromStr(Box<dyn Error + Send + Sync>),
}
